        <input type="text" onChange={(e)=>setApt(e.target.value)} class="input-box" />
        <br/>
        <label>City</label>
        <input type="text" onChange={(e)=>setCity(e.target.value)}class="input-box" name="city"/>
        <br/>
        <button  onClick={handleClick}>Submit</button>
